import React from 'react';
import { FaLinkedin, FaGithub } from 'react-icons/fa'; // Import the Font Awesome icons
import '../styles/LinkBar.css';


const LinkBar: React.FC = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <a href="your-linkedin-url" target="_blank" rel="noopener noreferrer">
              <FaLinkedin /> {/* LinkedIn icon */}
            </a>
          </li>
          <li>
            <a href="your-github-url" target="_blank" rel="noopener noreferrer">
              <FaGithub /> {/* GitHub icon */}
            </a>
          </li>
          <li>Resume</li>
        </ul>
      </nav>
    </div>
  );
};

export default LinkBar;
